import React from 'react';

const Header = ()=>{
    return(
        <header className='header'>
            <div>
                <h1>سرادق لتنظيم الفعاليات</h1>
                <p>منن حن
مسؤس ة ذا ت كفاء ا ت وخبر ا ت عالی ة فيتقدیم ا ف ضل
ال خدم ات الإبد اع ی ة في إردا ة وتنظ ی م جمی ع افلع ایلات
و املؤ تمر ات با لإض افة لتنس یق و تن ظ یم جمی ع خ طط
الأنشط ة املدرس یة عىل م ا در اعل ام.</p>
            </div>
        </header>
    )
}
export default Header;
